import React from "react";
import Home from "./components/Home";
import Regular from "./components/Regular";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
    <nav>
      <ul>
        <li></li>
      </ul>

    </nav>
  <Routes>
    <Route path="/" element={<Home />} />
    <Route path="/regular" element={<Regular />} />
  </Routes>
  </>
  )
}
// <div>
//   <p>hello word</p>
//   <Home />
//   <Regular />
// </div>

export default App;
